import React from 'react';

const NotFound = () => {
    return (
        <div style={{ textAlign: 'center', color: 'red' }}>
            <h1>ERROR!</h1>
            <br />
            <h1>404!!!!!!!!!</h1>
        </div>
    );
};

export default NotFound;
